import React, {Component, Fragment} from 'react'
import myImage from './ahmed.jpg'
class Col extends Component{
    render(){
        return(
            <>
                <td><img src={myImage} width='100px' height='100px'/></td>
                <td>two</td>
                <td>three</td>
            </>
        );
    }
}

export default Col;
